import React from 'react';
// import { Route, Link } from 'react-router-dom'
import Island from './Island'

const Islands = (props) => {
  return (
    <div>
      {props.islands.map(island => 
        <li key={island.id}></li>
        )}
    </div>
  )
}

export default Islands;
